import React from 'react';
import { Container, Grid } from 'semantic-ui-react';
import layout from './layout';


const receiptGenerator = () => {
    return (
        <Container>
            <div >
                <input value="Your Company Name" />
                <input value="INVOICE" />
                <div class="span-12">
                    <input value="123 Your Street"/>
                    <input value="Your Town"/>
                    <input value="Address Line 3"/>	
                    <input style="margin-top:20px;" value="(123) 456 789"/>
                    <input style="margin-bottom:30px;" value="email@yourcompany.com"/>
                </div>
                <div >
                    <input value="12/11/2010"/>
                    <input value="Invoice #2334889"/>
                    <input value="PO 456001200"/>
                    <input style="margin-top:20px;" value="Att: Ms. Jane Doe"/>
                    <input style="margin-bottom:30px;" value="Client Company Name"/>
                </div>
            </div>
        </Container>
    );
}

export default receiptGenerator;
